import React from "react";
import classes from "../card.module.css";

function User({ data, HandelerSubmitfunc, ChangeHandeler, username, age }) {
  return (
    <div className={classes.card}>
      <form onSubmit={HandelerSubmitfunc}>
        <input
          name="username"
          type="text"
          value={username}
          onChange={ChangeHandeler}
        />
        <input
          className={classes.input}
          name="age"
          type="text"
          value={age}
          onChange={ChangeHandeler}
        />
        <input type="submit" />
      </form>
      {data.length == 0 ? (
        <h3>no data to show </h3>
      ) : (
        <h3>
          {data.map((v) => (
            <div>
              <h3>{v.username}</h3>
              <h3>{v.age}</h3>
            </div>
          ))}
        </h3>
      )}
    </div>
  );
}

export default User;
